userIssues.body:
## Description
As part of the project setup process, it would be great to automatically create a new Figma file for the project. This would provide a starting point for design work related to the project.

## Details
- Use the Figma REST API to create a new file.
- The name of the file should be the same as the project name provided by the user.
- After the file is created, display a message with a link to the new Figma file.

## Code
Here's a basic example of how this might be implemented using Node.js and the axios library:

```js
const axios = require('axios');

async function createFigmaFile(projectName) {
  try {
    const response = await axios.post(
      'https://api.figma.com/v1/files',
      { name: projectName },
      {
        headers: {
          'X-Figma-Token': 'YOUR_FIGMA_PERSONAL_ACCESS_TOKEN'
        }
      }
    );

    console.log(`New Figma file created for ${projectName}! You can access it here: https://www.figma.com/file/${response.data.file_key}`);
  } catch (error) {
    console.error('Failed to create Figma file:', error);
  }
}

// Call the function with the project name
createFigmaFile(projectName);
```


Please replace 'YOUR_FIGMA_PERSONAL_ACCESS_TOKEN' with your actual Figma personal access token.

Considerations
- User needs to get auth token first
- Be aware that creating and managing Figma files programmatically may require a Figma Professional, Organization, or Education plan.
